import { useEffect, useState, useRef, Dimensions, Image, StyleSheet, View  } from 'react';
import { motion, useAnimation, useMotionValue, useTransform } from "framer-motion";
import { useInView } from "react-intersection-observer" 
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AOS from "aos";
import "aos/dist/aos.css"
import {fadeIn} from "react-fade-in"
import "../../src/style.css"
import {useSpring, animated as a} from "react-spring"
import {Carousel} from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import Swiper from 'swiper';
import { useMediaQuery } from 'react-responsive';
import "../../node_modules/swiper/swiper.css";
import "../../node_modules/swiper/swiper.min.css";
import photoMe from "../Components/SpringIn/AboutMe/Images/photoMe.jpeg"
import setup from "../Components/SpringIn/AboutMe/Images/setupPhoto.jpeg"
import espcs from "../Components/SpringIn/AboutMe/Coisas/AboutMe.json"

export default function Contact(){
    // hamburguer
  const [active, setActive] = useState(false); 
  const toggleMenu = () => { 
    setActive(!active);
  };

  // Cursor effect
  const [mousePosition, setMousePosition] = useState({
    x: 0,
    y: 0
  })
  const [cursorVariant, setCursorVariant] = useState("default");
  
  useEffect(() =>{
    const mouseMove = e => {
      setMousePosition({
        x: e.clientX,
        y: e.clientY
      })
      
    }
    

    window.addEventListener("mousemove", mouseMove)

    
    return () => {
      window.removeEventListener("mousemove", mouseMove)
    }
  }, []); // executado uma vez devido à array vazia
  
  const variants = {
    default: {
      x: mousePosition.x - 16,
      y: mousePosition.y - 16  
    },
    container: {
      
      backgroundColor: "orange",
      x: mousePosition.x - 16,
      y: mousePosition.y - 16
    },

    
  }

  const containerEnter = () => setCursorVariant("container");
  const containerLeave = () => setCursorVariant("default")



  

    // scroll effect


    useEffect(()=>{
      AOS.init({
        duration: 1000, // duração da animação em milissegundos
        offset: 200, // offset (em pixels) em relação ao topo do elemento em que a animação é disparada
        easing: "ease-in-out", // tipo de easing utilizado na animação
        delay: 100 // ttempo (em milissegundos) de atraso antes do início da animação
      });
      
     
    }, [])

    // Pegando coisas do AboutMe.json

    const [especialidades, setEspecialidades] = useState([]);

    useEffect(() => {
        setEspecialidades(espcs || []);
      }, []);

// Manipulando formulário

function Formulario(){
  const handleBackgroundBlur = () => {
    const formElement = document.querySelector(".form")
    if (formElement){
      formElement.style.backgroundFilter = 'blur(8px)';
    }
  }
  return(
    <div className="form">
    <form className='fomulario1'>
    <label for="mensagem" className='nome'>Nome</label>
        <textarea type='text' className='textArea' placeholder='Digite seu nome'></textarea>
    </form>
    <form className='formulario2'>
    <label for="mensagem" className='email2'>Email</label>
        <textarea type='text' className='textArea' placeholder='Digite sua senha'></textarea>
    </form>
    <label for="mensagem" className='selecione'>Em que posso ajudar você?</label>
    <select  name="opcoes" className='select1'>
        <option >1</option>
        <option>1</option>
        <option>1</option>
        <option>1</option>
    </select>
    <label for="mensagem" className='selecione2'>Qual tempo estimado?</label>
    <select  name="opcoes" className='select2'>
        <option >1</option>
        <option>1</option>
        <option>1</option>
        <option>1</option>
    </select>
</div>

  )
}

    return(
        <>
         <div className='navBar2'
    onMouseEnter={containerEnter} 
    onMouseLeave={containerLeave}
    >

      <motion.div 
    className="cursor"
    variants={variants}
    animate={cursorVariant}
